import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter, Route } from "react-router-dom";

import NavBar from './NavBar';

function App() {
  return (
    <div className='container md-5'>
      <Route path='/' component={Navbar} />
    </div>
  );
}

export default App;
